import React, { useState } from "react";
import "./Register.css";

const Register = () => {
  const FormChange = useState({
    fname: "",
    mname: "",
    lname: "",
    email: "",
    phone: "",
  });

  const change = (event) => {
    const val = event.target.value;
    const nam = event.target.name;

    if (nam == "fname") {
      setFormChange({
        fname: val,
      });
    }

    if (nam == "mname") {
      setFormChange({
        mname: mname,
      });
    }

    if (nam == "lname") {
      setFormChange({
        lname: val,
      });
    }

    if (nam == "fname") {
      setFormChange({
        fname: val,
        mname: "",
        lname: "",
        email: "",
        phone: "",
      });
    }

    if (nam == "fname") {
      setFormChange({
        fname: val,
        mname: "",
        lname: "",
        email: "",
        phone: "",
      });
    }
  };

  return (
    <>
      <div className="register-form">
        <form>
          <input
            type="text"
            placeholder="First Name"
            name="fname"
            onChange={change}
          />

          <input
            type="text"
            placeholder="Middle Name"
            name="mname"
            onChange={change}
          />

          <input
            type="text"
            placeholder="Last Name"
            name="lname"
            onChange={change}
          />
        </form>
      </div>
    </>
  );
};

export default Register;
